import React, { Component } from 'react';
import './App.css';
import { BrowserRouter, BrowserRouter as Router } from 'react-router-dom';
import { Routes, Route, } from 'react-router-dom';

import Sidebar from './components/sidebar/Sidebar';
import About from './components/about/About';
import Education from './components/Education/Education';
import Interest from './components/skills/Interest';
import Projects from './components/Projects/Projects.js';
import CarouselImages from './components/Carousel/Carousel';
import Contact from './components/contact/contact';
// import Getallusers from './components/contact/getAllUsers';

class App extends Component {
  render() {
    return (<>
      <BrowserRouter>

      </BrowserRouter>
      <Router>
        <div className='App'>
          <div className='side'>
            <nav className='navbar side navbar-expand-lg navbar-light p-0'>
              <button
                className='navbar-toggler'
                type='button'
                data-toggle='collapse'
                data-target='#navbarSupportedContent'
                style={{ zIndex: '1' }}
              >
                <span className='navbar-toggler-icon'></span>
              </button>
              <div className='collapse navbar-collapse' id='navbarSupportedContent'>
                <Sidebar />
              </div>
            </nav>
          </div>
          <div className='main'>
            <CarouselImages />
            <Projects />
            <About />
            <Interest />
            <Education />
            <Contact/>
            {/* <Getallusers/> */}
          </div>
        </div>
      </Router>
      </>
    );
  }
}

export default App;
